function App(){

  const [data, SetData] = useState([{}])


  useEffect(()=> {

    fetch("https://restcountries.com/v3.1/name/colombia?fullText=true").then(

      res=> res.json()
    ).then(
        data=> {

          SetData(data)
          console.log(data)

        }
    )
  }, [])





  return(

    <div>


    </div>



  )





}

export default App;
